ation Technology (MCIT), Egypt\nFocus on data analysis, data visualization, and Python programming\nPractical training using Excel, Python (pandas, matplotlib), and real-world \ndatasets\n06/2025\nTanta,Egypt\nDeveloped skills in data cleaning, exploratory data analysis (EDA), and \ncommunicating insights\nProfessional Experience\nFreelance Data Analyst, Various Platforms\nDelivered Excel, Power BI, and Tableau projects to clients on Khamsat, Mostaql, \nNafizly, and FreelanceYard.\nConducted data cleaning, trend analysis, and KPI reporting for multiple clients.\n2025  Present\nBuilt dashboards and visualizations that support actionable business decisions.\nData Analyst Intern / Projects, Digital Egypt Pioneers Initiative\nAnalyzed real-world datasets using Excel, Python, Power BI, and Tableau.\nDeveloped interactive dashboards for performance tracking and business \ninsights.\n06/2025  Present\nTanta, Egypt\nCleaned and transformed raw data to prepare for analysis.\nApplied data storytelling techniques to present findings clearly to stakeholders.\nGIS \u0026 Surveying Specialist, Arab Contractors Company\nCollected, analyzed, and visualized spatial data for infrastructure and \nconstruction projects.\nUtilized GIS tools to create detailed maps and spatial reports for project planning \nand execution.\n11/2024\nMansoura, Egypt\nCollaborated with engineering teams to ensure accuracy of geospatial data and \nsite measurements.\nProjects\nFIFA World Cup Data Analysis (19302014)\nAnalyzed historical FIFA World Cup data using Excel, including team performance, goals scored, and \ntournament trends.\nUsed Pivot Tables, charts, and conditional formatting to visualize patterns over the years.\nExtracted key insights about top-performing countries, goal distribution, and host country performance.\nDemonstrated strong skills in data cleaning, visualization, and storytelling with data.\nSupply Chain Dataset Analysis\nDescription: Conducted end-to-end supply chain data analysis, including data cleaning, preprocessing, \nforecasting, and visualization.\nTools: Python (pandas, Matplotlib, scikit-learn), SQL, Power BI, Tableau\nKey Achievements:\nBuilt a cleaned and preprocessed dataset ready for analysis.\nDefined analysis and forecasting questions relevant to business decisions.\nCreated interactive dashboards in Tableau and Power BI to communicate insights.\nDelivered a final report and presentation summarizing insights, trends, and recommendations.\nInteractive Tableau Dashboard, Sales Data Analysis\nDescription: Developed an interactive Tableau dashboard to analyze and visualize sales data.\nTools: Tableau\nKey Achievements:\nBuilt bar charts (sales by category), line charts (monthly trends), and maps (sales by region).\nAdded filters and interactive elements for dynamic exploration.\nDesigned a professional, user-friendly dashboard, highlighting most profitable regions.\nOnline Courses Dataset Analysis (Excel)\nDescription: Analyzed a dataset of online courses to extract insights on popularity, pricing, and distribution.\nTools: Microsoft Excel (Pivot Tables)\nKey Achievements:\nCalculated number of courses per subject using Pivot Tables.\nIdentified top 10 courses by number of subscribers.\nComputed average course price per subject.\nAnalyzed course distribution by level and published year trends.\nFreelance \u0026 Contact Links\nKhamsat\nMostaql\nNafezly\nFreelanceYard\nWhatsApp\nBuild a clean, professional portfolio website for Basant Mohamed Alsmahy, Data Analyst from Cairo, Egypt. Include sections:\nAbout Me: Experienced in Excel, Python, Power BI, Tableau, GIS. Skilled in data cleaning, analysis, visualization, and turning data into actionable insights.\nSkills: Excel, Power BI, Tableau, Python, GIS, Data Analysis, Dashboard Creation\nExperience: Freelance Data Analyst (Khamsat, Mostaql, Nafezly, FreelanceYard), Data Analyst Intern  Digital Egypt Pioneers, GIS \u0026 Surveying Specialist  Arab Contractors\nProjects: FIFA World Cup Data Analysis, Supply Chain Dataset Analysis, Tableau Sales Dashboard, Online Courses Dataset Analysis\nContact / Links: Email, LinkedIn, GitHub, Freelance Platforms (Khamsat, Mostaql, Nafezly, FreelanceYard), WhatsApp\nUse a modern, clean, professional design. Highlight freelance platform logos in soft bright blue. Make all sections editable for future updates.","portfolioImage":"https://s3.amazonaws.com/media-prod.butternut.ai/website_images/portfolio/acf397fb-dd54-4d2f-89b5-88d554049826.webp","portfolioLinks":["mailto:basantalsmahy3@gmail.com","tel:01062613644","https://linkedin.com/in/basant-alsmahy-8437952aa","https://github.com/basantalsmahy3/FIFA_WorldCup_Analysis","https://github.com/basantalsmahy3/Supply-Chain-Dataset-Analysis-Group-4","https://github.com/basantalsmahy3/Sales_Data_Analysis_Tableau_Dashboard","https://github.com/basantalsmahy3/Online-Courses-Dataset-Analysis-Excel-/tree/main","https://khamsat.com/user/basant_alsmahy01","https://mostaql.com/u/Basant_02","https://nafezly.com/u/basant_alsmahy","https://www.freelanceyard.com/ar/account/profile","https://wa.me/message/C2RI5ZRDPCGTP1"],"resumeUrl":"https://s3.amazonaws.com/media-prod.butternut.ai/website_images/resume-image-upload/1764161685.383811_Basant-Mohamed-Alsmahy-FlowCV-Resume-20251126_1.pdf"},"org_name":"Basant Mohamed Alsmahy","pages":[{"_id":{"$oid":"6926f8d828310c8e43369766"},"landing_page_type":"Portfolio","meta":{"description":"Transforming complex data into insights. Excel, Python, Power BI, and Tableau expertise. Contact Basant in Cairo for professional analytics services.","title":"Basant Alsmahy - Expert Data Analyst"},"order_index":0,"page_id":"2ltb9HJw8TjvHQ1764161752","sections":[{"active":true,"blockProps":{"html":"\u003cstyle\u003e\n  /* Navbar Styling */\n  .portfolio-navbar {\n    background-color: var(--landing-background);\n    border-bottom: 1px solid #333333;\n    padding: 24px 0px;\n    width: 100%;\n  }\n\n  .portfolio-navbar-container {\n    max-width: 1200px;\n tion_purpose":"Establishes credibility through education, core skills, and professional approach in minimal format"},{"content_requirements":"Section heading: 'Experience' in minimal typography. Experience entries: 1) 'Freelance Data Analyst' (2025-Present) - 'Delivering Excel, Power BI, and Tableau projects across multiple platforms. Conducting data cleaning, trend analysis, and KPI reporting. Building dashboards that support actionable business decisions.' 2) 'Data Analyst Intern, Digital Egypt Pioneers Initiative' (06/2025-Present) - 'Analyzing real-world datasets using Excel, Python, Power BI, and Tableau. Developing interactive dashboards for performance tracking.' 3) 'GIS \u0026 Surveying Specialist, Arab Contractors Company' (11/2024) - 'Collected and visualized spatial data for infrastructure projects using GIS tools.' No images needed.","design_notes":"Maintains minimal black and white theme. Each experience entry with job title, dates, and brief description in left-aligned format. Subtle hierarchy with job titles slightly larger than descriptions. Generous vertical spacing (60px) between entries. Consistent with overall minimal aesthetic. Hairline dividers between major experience blocks if needed.","order":3,"section_id":"experience","section_name":"Professional Experience","section_purpose":"Showcases work history and current freelance focus to build trust and demonstrate career progression"},{"content_requirements":"Section heading: 'Projects' in minimal style. Project entries: 1) 'FIFA World Cup Data Analysis (1930-2014)' - 'Analyzed historical data using Excel, including team performance and tournament trends. Used Pivot Tables and charts to visualize patterns.' GitHub link: 'https://github.com/basantalsmahy3/FIFA_WorldCup_Analysis'. 2) 'Supply Chain Dataset Analysis' - 'End-to-end analysis including data cleaning, forecasting, and visualization using Python, SQL, Power BI, and Tableau.' GitHub link: 'https://github.com/basantalsmahy3/Supply-Chain-Dat
